CREATE DATABASE IF NOT EXISTS `d2r` DEFAULT CHARACTER SET utf8;

USE `d2r`;

DROP TABLE IF EXISTS `offer`;
CREATE TABLE `offer` (
  `nr` int(11) primary key,
  `product` int (11),
  `producer` int (11),
  `vendor` int (11),
  `price` double default null,
  `validFrom` date default null,
  `validTo` date default null,
  `deliveryDays` int(11) default null,
  `offerWebpage` varchar(100) character set utf8 collate utf8_bin default NULL,
  `publisher` int(11),
  `publishDate` date,
  INDEX USING BTREE (product),
  INDEX USING BTREE (vendor)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

